import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { SharedModule } from 'app/shared/shared.module';
import { FontAwesomeModule } from '@fortawesome/angular-fontawesome';
import { AutoCompleteModule } from 'primeng/autocomplete';
import { ButtonModule } from 'primeng/button';
import { CalendarModule } from 'primeng/calendar';
import { CheckboxModule } from 'primeng/checkbox';
import { ConfirmPopupModule } from 'primeng/confirmpopup';
import { DialogModule } from 'primeng/dialog';
import { DropdownModule } from 'primeng/dropdown';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { InputTextModule } from 'primeng/inputtext';
import { MultiSelectModule } from 'primeng/multiselect';
import { PanelModule } from 'primeng/panel';
import { TableModule } from 'primeng/table';
import { ToastModule } from 'primeng/toast';
import { ConfirmationService, MessageService } from 'primeng/api';
import { DialogService } from 'primeng/dynamicdialog';
import { NspConfirmationService } from 'app/shared/confirm/nsp-confirm.service';
import { IcCodeService } from 'app/ng-connect';
import { FormlyMapService } from 'app/shared/service/formly-map.service';
import { EditHardcopySeComponent } from './edit-hardcopy-se/edit-hardcopy-se.component';
import { ToolbarModule } from 'primeng/toolbar';
import { SEClaimRoutingModule } from './route/se-claim-routing.module';
import { SeClaimVerificationComponent } from './se-claim-verification/se-claim-verification.component';
import { ClaimSectionComponent } from './se-claim-verification/claim-section/claim-section.component';
import { IrasDldDetailsSectionComponent } from './se-claim-verification/iras-dld-details-section/iras-dld-details-section.component';
import { WorkingDataSectionComponent } from './se-claim-verification/working-data-section/working-data-section.component';
import { ItemDetailsSectionComponent } from './se-claim-verification/item-details-section/item-details-section.component';
import { ProgressSpinnerModule } from 'primeng/progressspinner';
import { AccordionModule } from 'primeng/accordion';
import { InsuranceIncomeTaxComponent } from './se-claim-verification/working-data-section/insurance-income-tax/insurance-income-tax.component';
import { SerbApprovalSectionComponent } from './se-claim-verification/serb-approval-section/serb-approval-section.component';
import { SerbRationaleAmendmentSectionComponent } from './se-claim-verification/serb-rationale-amendment-section/serb-rationale-amendment-section.component';
import { ActualTrainingDetailsSectionComponent } from './se-claim-verification/actual-training-details-section/actual-training-details-section.component';
import { ItemChangeHistorySectionComponent } from './se-claim-verification/item-change-history-section/item-change-history-section.component';
import { ToggleButtonModule } from 'primeng/togglebutton';
import { InsertItemDialogComponent } from './se-claim-verification/item-details-section/insert-item-dialog/insert-item-dialog.component';
import { PartnerComponent } from './se-claim-verification/working-data-section/partner/partner.component';
import { SolePropComponent } from './se-claim-verification/working-data-section/sole-prop/sole-prop.component';
import { PropertyAgentComponent } from './se-claim-verification/working-data-section/property-agent/property-agent.component';
import { OthersLegacyComponent } from './se-claim-verification/working-data-section/others-legacy/others-legacy.component';
import { PrivateHirerDriverComponent } from './se-claim-verification/working-data-section/private-hirer-driver/private-hirer-driver.component';
import { TaxiComponent } from './se-claim-verification/working-data-section/taxi/taxi.component';
import { TooltipModule } from 'primeng/tooltip';
import { ReplacementComponent } from './se-claim-verification/working-data-section/replacement/replacement.component';
import { OthersComponent } from './se-claim-verification/working-data-section/others/others.component';
import { OthersSerbTableComponent } from './se-claim-verification/working-data-section/others/others-serb-table/others-serb-table.component';
import { AnnualIncomeComponent } from './se-claim-verification/working-data-section/annual-income/annual-income.component';
import { InsuranceAvgIncomeComponent } from './se-claim-verification/working-data-section/insurance-avg-income/insurance-avg-income.component';
import { ViewLatestOwnerSeComponent } from './pop-up/view-latest-owner-se/view-latest-owner-se.component';
import { ViewEclaimComponent } from './pop-up/view-eclaim/view-eclaim.component';
import { AdditionalEclaimInfoSectionComponent } from './pop-up/view-eclaim/additional-eclaim-info-section/additional-eclaim-info-section.component';
import {
  ItemDetailsSectionForEclaimComponent
} from "app/claim/se-claim/pop-up/view-eclaim/item-details-section/item-details-section-for-eclaim.component";
import {
  ClaimSectionForEclaimComponent
} from "app/claim/se-claim/pop-up/view-eclaim/claim-section/claim-section-for-eclaim.component";
import { ViewIrasComponent } from './pop-up/view-iras/view-iras.component';
import { ViewSerbReportComponent } from './pop-up/view-serb-report/view-serb-report.component';
import { ClaimSuppDocComponent } from '../pop-up/view-supporting-doc/claim-supp-doc/claim-supp-doc.component';
import { SplitButtonModule } from 'primeng/splitbutton';
import { SeClaimCertificationComponent } from './se-claim-certification/se-claim-certification.component';


@NgModule({
  declarations: [
    EditHardcopySeComponent,
    ClaimSectionComponent,
    SeClaimVerificationComponent,
    IrasDldDetailsSectionComponent,
    WorkingDataSectionComponent,
    ItemDetailsSectionComponent,
    InsuranceIncomeTaxComponent,
    InsuranceAvgIncomeComponent,
    SerbApprovalSectionComponent,
    SerbRationaleAmendmentSectionComponent,
    ActualTrainingDetailsSectionComponent,
    ItemChangeHistorySectionComponent,
    InsertItemDialogComponent,
    PartnerComponent,
    SolePropComponent,
    PropertyAgentComponent,
    OthersLegacyComponent,
    PrivateHirerDriverComponent,
    TaxiComponent,
    ReplacementComponent,
    OthersComponent,
    OthersSerbTableComponent,
    AnnualIncomeComponent,
    InsuranceAvgIncomeComponent,
    ViewLatestOwnerSeComponent,
    ViewEclaimComponent,
    AdditionalEclaimInfoSectionComponent,
    ItemDetailsSectionForEclaimComponent,
    ClaimSectionForEclaimComponent,
    ViewIrasComponent,
    ViewSerbReportComponent,
    SeClaimCertificationComponent

  ],
  imports: [
    CommonModule,
    SharedModule,
    AutoCompleteModule,
    ButtonModule,
    CalendarModule,
    CheckboxModule,
    ConfirmPopupModule,
    DialogModule,
    DropdownModule,
    FontAwesomeModule,
    FormsModule,
    ReactiveFormsModule,
    InputTextModule,
    MultiSelectModule,
    PanelModule,
    TableModule,
    ToastModule,
    ToolbarModule,
    SEClaimRoutingModule,
    ProgressSpinnerModule,
    AccordionModule,
    ToggleButtonModule,
    TooltipModule,
    SplitButtonModule
  ],
  providers: [ConfirmationService, MessageService, DialogService, NspConfirmationService, IcCodeService, FormlyMapService]
})
export class SEClaimModule { }
